import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Col, Nav, Row ,Tab} from "react-bootstrap";

function SystemAdmin() {

    const [dashboard, setdashboard] = useState();
    const [pets, setpets] = useState();
    const [appointment, setappointment] = useState();
    const [mycart, setmycart] = useState();
    const [visitormonitoring, setvisitormonitoring] = useState();
  
    useEffect(() => {
      if (props.active === "dashboard") {
        setdashboard("#19B9CC");
      } else if (props.active === "pets") {
        setpets("#19B9CC");
      } else if (props.active === "appointment") {
        setappointment("#19B9CC");
      } else if (props.active === "mycart") {
        setmycart("#19B9CC");
      } else if (props.active === "visitormonitoring") {
        setvisitormonitoring("#19B9CC");
      }
    }, []);
    return (
      <div id="sideNavBar">
        <Container
          style={{
            padding: 30,
          }}
        >
          <Image
            src={logo}
            style={{
              height: 40,
            }}
          />
          <a
            href="/"
            style={{
              fontWeight: "bold",
              marginLeft: 10,
              marginTop: 10,
              fontSize: 30,
              textDecoration: "none",
              color: "white",
            }}
          >
            TERRAVET
          </a>
        </Container>
        <hr />
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: dashboard,
          }}
        >
          <a id="anchorTag" href="/">
            <HiHome id="icons" />
            Home
          </a>
        </Container>
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: pets,
          }}
        >
          <MdPets id="icons" />
          <a id="anchorTag" href="/pets">
            Pets
          </a>
        </Container>
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: appointment,
          }}
        >
          <AiFillSchedule id="icons" />
          <a id="anchorTag" href="/appointment">
            Appointment
          </a>
        </Container>
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: mycart,
          }}
        >
          <MdPets id="icons" />
          <a id="anchorTag" href="/my&cart">
            My Cart
          </a>
        </Container>
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: visitormonitoring,
          }}
        >
          <AiFillSchedule id="icons" />
          <a id="anchorTag" href="/contact&tracing">
            Contact Tracing
          </a>
        </Container>
  
        <hr />
      </div>
    );
  }

export default SystemAdmin
